import React from 'react';
import Navbar from './components/Navbar';
import MainComponent from './components/MainComponent';
import Footer from './components/Footer';
import './App.css';


function App() {
  return (
    <div className="App">
      <Navbar />
      <MainComponent />
      <Footer />
    </div>
  );
}

export default App;
